import "./App.css";
import { BrowserRouter as Router, Route, Routes, Switch } from "react-router-dom";
import About from "./About";
import Home from "./Home";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" element={<Home/>} />
        <Route path="/about" element={<About/>} />
      </Switch>
    </Router>
  );
}

export default App;
